case 2. Improvement to existing type definition.
- Current types does not support submodule import so js bundle file includes used code.
- This PR embeds submodule types.
- Submodules are listed in this link: https://github.com/toji/gl-matrix/tree/master/src/gl-matrix

``` typescript

  // Current types only supports this form, so without tree-shaking 
  // unused code like mat4 is unwillingly injected to bundle file.
  import { vec3 } from 'gl-matrix';

  // Now with this PR, we can import only the submodule to use.
  import vec3 = require('gl-matrix/src/gl-matrix/vec3');
```
